import React from "react";

function Usuarios() {
    
    return(

        <table>
            <head>
                <tr>
                    <th>Id</th>
                    <th>Name</th>
                    <th>Username</th>
                    <th>City</th>
                    <th>Zipcode</th>
                    <th>Phone</th>
                    <th>Company name</th>
                    <th>Ubication</th>
                </tr>
            </head>
        </table>

    );
}

export default Usuarios;
